import React from 'react';
import s from './inform.module.css'
import InformBlock from "./informBlock";
import {faGem, faHeart, faMoon} from "@fortawesome/free-regular-svg-icons";
const Inform = () => {
    const informBlocks = [
        {icon:faGem, title:'Unique by Design', information:"Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus."},
        {icon:faHeart, title:'Straightforward Features', information:"Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus."},
        {icon:faMoon, title:'Top Notch Customer Support', information:"Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus."},
    ]
    return (
        <div className={s.informContainer}>
            <div className={s.inner} >
                {informBlocks.map((block,index)=><InformBlock key={index} block={block}/>)}
            </div>

        </div>
    );
};

export default Inform;
